Given the complexity and the need to account for different periods and conflicts, a single SPARQL query might not capture all nuances. However, we can start with a basic query to find individuals associated with these roles:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbo: <http://dbpedia.org/ontology/>

SELECT ?person 
WHERE {
  ?person a dbo:CommanderInWar ;
            dbo:conflict "Rif War" .

  ?person a dbo:CommanderInWar ;
            dbo:conflict "Spanish Civil War" .

  ?person a dbo:LeaderOfOrganization ;
            dbo:organization dbo:Ministry_of_the_Air_(Spain) .
}
```

This query looks for individuals who were commanders in the Rif War, Spanish Civil War, and leaders of the Ministry of the Air (Spain). It might return multiple results, as there were several commanders and leaders during these periods.

Given the ambiguity in the question, a SPARQL query cannot be definitively constructed without additional context or data. If we assume that "work" refers to a musical album, then we might construct a query to find albums associated with Matt Freeman:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbpedia: <http://dbpedia.org/ontology/>

SELECT ?album WHERE {
  ?album a dbpedia:MusicAlbum ;
          dbpedia:performer [ dbpedia:hasMember "Matt Freeman" ] .
}
```

This query looks for albums where Matt Freeman is a performer. However, this does not guarantee that the album is also considered a "work" in all contexts (e.g., a literary work or a piece of visual art).

